import React from 'react';
import style from './Title.module.css';

function Title({textChanged}) {
  if (!textChanged) {
    return null;
  }

  return (
    <div className={style.container}>
        <div className={style.title}>
            <h1>AreA</h1>
        </div>
    </div>
  );
}

export default Title;
